import React, { Component } from 'react';
import Contacts from './components/contacts';

class App extends Component {

    state = {
        contacts: []
    }
    componentDidMount() {
        fetch('http://localhost:8080/api/restaurants/6/menu').then(response => {
            this.setState({contacts: response.entity._embedded.dishes});
        });
    }

    render() {
        return (
            <Contacts contacts={this.state.contacts} />
        )
    }
}

export default App;
